import { Button, Form, Table, Card, Container, Row, Col } from "react-bootstrap";
import React, { useRef, useEffect, useState } from "react";
import { testLogestechsArea/* , recordRechargeBalance */, getLogisticsVillagesTest, getAllCitiesTest } from "../APIs/OrdersAPIs";


export default function TestComponent() {

    const [citiesAr, setCitiesAr] = useState([]);
    const [citiesEn, setCitiesEn] = useState([]);

    useEffect(() => {
        getAllCitiesTest(1).then(res => {
            setCitiesEn(res.data);
        })

        getAllCitiesTest(2).then(res => {
            setCitiesAr(res.data);
        })
    })

    /* useEffect(() => {
        getLogisticsVillagesTest().then(res => {
            console.log(res.data);
        })
    }, []) */

    return (
        <Container fluid className="p-5">
            <Row>
                <Col>
                    <Card>
                        <Card.Header>
                            English
                        </Card.Header>
                        <Card.Body>
                            <Table striped bordered hover className="w-100">
                                <thead>
                                    <tr>
                                        <th>City ID</th>
                                        <th>City Name</th>
                                        <th></th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {
                                        citiesEn.map((city, index) => {
                                            return <tr key={index}>
                                                <td>{city.cityId}</td>
                                                <td>{city.name}</td>
                                                <td></td>
                                            </tr>
                                        })
                                    }
                                </tbody>
                            </Table>
                        </Card.Body>
                    </Card>
                </Col>
            </Row>

            <Row>
                <Col>
                    <Card>
                        <Card.Header>
                            English
                        </Card.Header>
                        <Card.Body>
                            <Table striped bordered hover className="w-100">
                                <thead>
                                    <tr>
                                        <th>City ID</th>
                                        <th>City Name</th>
                                        <th></th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {
                                        citiesAr.map((city, index) => {
                                            return <tr key={index}>
                                                <td>{city.cityId}</td>
                                                <td>{city.name}</td>
                                                <td></td>
                                            </tr>
                                        })
                                    }
                                </tbody>
                            </Table>
                        </Card.Body>
                    </Card>
                </Col>
            </Row>
        </Container>
    )
}
